script: |
  super -f text -I q5050.spq | sort > q5050.out

inputs:
  - name: q5050.spq
    data: |
      SELECT ALL - 62 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE + 77 * ( 95 ) NOT BETWEEN ( NULL ) AND ( col0 );
  - name: tab2

outputs:
  - name: q5050.out
    data: |
      -62
      -62
      -62
